import React, {Component} from 'react'
import logo from './logo.svg';
import './App.css';
import UploadFiles from "./components/upload-files.component";
import DocViewer from "react-doc-viewer";
import DocProvider from './providers/DocProvider'
import DocContext from './providers/DocContext';
import './App.scss';
import { Button, Content } from 'carbon-components-react';
import DataCapHeader from './components/DataCapHeader';
import { Route, Switch } from 'react-router-dom';
import LandingPage from './content/LandingPage';
import DataCap from './content/DataCap';
class App extends Component {



  constructor(props){
    super(props);
    this.state = {
      message : ""
    }
  }
  render(){
    return (
      <DocProvider>

        <DataCapHeader />
        <Content>
          <h2>
          Welcome to DataCap Uploader
          </h2>


          <Switch>
            <Route exact path="/" component={LandingPage} />
            <Route path="/repos" component={RepoPage} />
          </Switch>



      </Content>
      </DocProvider>
    );
  }
}

export default App;
